import React, { useEffect, useState } from "react";
import { portrait } from "../public/portrait";
import { photoList } from "../public/photoList";

export default function Dummy() {
  let pictures = photoList;

  function mapPhotosToIndex(pictures) {
    return pictures.map(photo => (

      <div class="dummy-col-index">
          <img
            id={`thumb_${photo.number}`}
            src={`/photos_good/thumbnails/${photo.number}.png`}
            alt="..."
            class= "dummy-photoIndex"
          />
      </div>
    ));
  }

  return (
    <div class="dummy-photoIndexRow">
      <div class="row dummy-photoIndex">
          {mapPhotosToIndex(pictures)}
      </div>
    </div>
  );
}
